import React from 'react'

export default function Navbar() {
  return (
    <nav id='navbar'>
        <h2>Portfolio Maker</h2>
        <div className='links'>
            <button>Hire Employee</button>
            <button>Create</button>
        </div>
    </nav>
  )
}
